import React, { Component } from "react";
import { GoogleMap, LoadScript, InfoWindow } from "@react-google-maps/api";
import { API_KEY_MAPS } from "../services/index";

const containerStyle = {
  width: "100%",
  height: "400px",
};

const divStyle = {
  background: `white`,

}

class Map extends Component {
  constructor(props) {
    super(props);
  }

  render() {

    const position ={
      lat:parseFloat(this.props.lat),
      lng:parseFloat(this.props.lon)
    }
    let info_window = ""
    if (this.props.humidity != ""){
      info_window = <InfoWindow  position={position}>
      <div style={divStyle}>
        <strong>Humedad de: {this.props.humidity}</strong>
      </div>
    </InfoWindow>
    }

    return (
      <LoadScript googleMapsApiKey={API_KEY_MAPS}>
        <GoogleMap
          mapContainerStyle={containerStyle}
          center={position}
          zoom={10}
        >
          {info_window}
          <></>
        </GoogleMap>
      </LoadScript>
    );
  }
}

export default Map;
